INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (0, 2, 586, 60005, "", 0, 0, 0, 3, "", 1, "今日の運勢は中吉！　歌を口ずさみ、幸運を呼び込もう！\n幸運になれるかは分からないけど……一緒に、歌いましょ？");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (0, 2, 587, 60005, "", 0, 0, 0, 3, "", 1, "今日の運勢は中吉！　健康に気を遣って気持ちのいい一年を！\n体に不調があるときは遠慮なく言いなさい、隅々まで調べてあげる");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (0, 2, 588, 60005, "", 0, 0, 0, 3, "", 1, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (0, 2, 589, 60005, "", 0, 0, 0, 3, "", 2, "今日の運勢は中吉！　争いごとは勝つが油断は大敵！　　　　　　ま、このあたしと一緒なら、向かうところ敵はねーですよっ！");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (0, 2, 590, 60005, "", 0, 0, 0, 3, "", 2, "今日の運勢は中吉！　ラッキーアイテムは「光るもの」！　　　　ハツネちゃんの「きらーんっ☆」な魔法、見せちゃおうかなっ？");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (0, 2, 591, 60005, "", 0, 0, 0, 4, "", 1, "今日の運勢は小吉！　のんびり穏やかな一日となるでしょう！　　あなた様を邪魔するものは全てエリコが排除しますわ、クスクス♪");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (0, 2, 592, 60005, "", 0, 0, 0, 4, "", 1, "今日の運勢は小吉！　小さな勇気で踏み出す一歩が大事！\n遠くから見てるだけじゃダメ。今日は、少しだけ近づいてみます！");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (0, 2, 593, 60005, "", 0, 0, 0, 4, "", 1, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (0, 2, 594, 60005, "", 0, 0, 0, 4, "", 1, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (0, 2, 595, 60005, "", 0, 0, 0, 4, "", 1, "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (0, 2, 596, 60005, "", 0, 0, 0, 4, "", 2, "今日の運勢は小吉！　空を眺めると気持ちが晴れやかに！　　　　眺めるだけじゃなくて、ひとっ飛びしちゃいましょうかっ♪");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (0, 2, 597, 60005, "", 0, 0, 0, 4, "", 2, "今日の運勢は小吉！　掃除をすると運勢が開けそう！　　　　　　「わ、めんど」「ヴルムっ！　新年早々サボっちゃダメなんだからね！」");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (190804, 3, 598, 60005, "", 0, 2, 0, 0, "カリン", 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (190804, 3, 599, 60005, "", 7, 3, 0, 0, "カリン", 0, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (190804, 1, 600, 60006, "", 0, 1, 0, 0, "カリン", 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (0, 2, 601, 60006, "", 0, 0, 0, 1, "", 2, "今日の運勢は姫吉！　勇気を持って、新しいことに挑戦しよう！\n幸先がいいねえ少年！　今年もいい一年になるよう祈ってるよ。");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (0, 2, 602, 60006, "", 0, 0, 0, 1, "", 2, "今日の運勢は姫吉！　どんなピンチも簡単に乗り越えられそう！\nよい結果が出たようで何よりです。さて、待人の方は……ふふ。");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (0, 2, 603, 60006, "", 0, 0, 0, 1, "", 2, "今日の運勢は姫吉！　あの人と仲直り……できちゃうかも！？\nはあ……この私があなたの運勢に興味を抱くわけないでしょう？");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (0, 2, 604, 60006, "", 0, 0, 0, 2, "", 1, "今日の運勢は大吉！　身近な友達との絆が深まる予感……？\n騎士様は、どなたと友誼を結ぶのでしょう？　気になります……");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (0, 2, 605, 60006, "", 0, 0, 0, 2, "", 2, "今日の運勢は大吉！　ラッキーアイテムは「蛇の抜け殻」！\nこのアタシにお目にかかれるなんて……アンタ、幸せものね♪");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (0, 2, 606, 60006, "", 0, 0, 0, 3, "", 2, "今日の運勢は中吉！　気になるあの人に会えちゃうかも！？\n『初夢を正夢にする枕』であなたに会え……な、なんでもない！");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (0, 2, 607, 60006, "", 0, 0, 0, 3, "", 2, "今日の運勢は中吉！　子供に戻って、一日中遊びつくそう！\nお年玉でけん玉ゲット！　おじちゃん、もしかめ一万回やって！");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (0, 2, 608, 60006, "", 0, 0, 0, 3, "", 1, "今日の運勢は中吉！　今日はおうちで、ゆーっくりくつろごう。\nお雑煮よし。みかんよし。さ、こたつで寝正月だ。君も入る？");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (0, 2, 609, 60006, "", 0, 0, 0, 4, "", 2, "今日の運勢は小吉！　突然のドッキリに注意！\nおや、後ろに髪の長い女の霊が──フフ、冗談です。私ですよ。");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (0, 2, 610, 60006, "", 0, 0, 0, 4, "", 2, "今日の運勢は小吉。慌てなくても、幸運はきっとやってくる。\n運は自分で掴むもの──媛が言ってました。でも、どうやって？");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (190804, 3, 611, 60006, "", 0, 2, 0, 0, "カリン", 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (190804, 3, 612, 60006, "", 5, 3, 0, 0, "カリン", 0, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします");
